SELECT ?spouseOfSpouse WHERE {
  # Find the child of Charles II of Naples
  dbr:Charles_II_of_Naples dbo:child ?child1 .

  # Find the child of Stephen V of Hungary
  dbr:Stephen_V_of_Hungary dbo:child ?child2 .
  ?child2 dbo:child ?childOfChild2 .

  # Find the spouse of the child of Charles II
  OPTIONAL {
    ?child1 dbo:spouse ?spouse1 .
    # Check if the spouse is royalty
    ?spouse1 dbo:royalty ?royalty1 .

    # Find the spouse of that spouse
    OPTIONAL {
      ?spouse1 dbo:spouse ?spouseOfSpouse .
    }
  }

  # Find the spouse of the child of the child of Stephen V
  OPTIONAL {
    ?childOfChild2 dbo:spouse ?spouse2 .
    # Check if the spouse is royalty
    ?spouse2 dbo:royalty ?royalty2 .

    # Find the spouse of that spouse
    OPTIONAL {
      ?spouse2 dbo:spouse ?spouseOfSpouse .
    }
  }
}
