          dbo:abstract ?abstract .

  FILTER (CONTAINS(LCASE(?abstract), "sports manager") &&
           CONTAINS(LCASE(?abstract), "soccer manager") &&
           CONTAINS(LCASE(?abstract), "soccer player"))

